import './App.css';
import React from 'react'
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import {LivretPage, ArbrePage, AlbumPage} from './components/NavigationPage';



class HelloMessage extends React.Component {
  // constructor (props){
  //   super(props)
  // }
  render() {
    console.log(this.props, ';;;;')
    return (
      <div>
        Salut {this.props.name} {this.props.name2}
      </div>
    );
  }
}


function App() {
  return (
    // <div className="App">
    //   <Header/>
    //   <NavigationPage/>
    //   <FirstPage/>
    //   <HelloMessage name="Thierry" name2="Thierry2"/>
    // </div>
    <Router>
        <div className="">
          {/* <NavigationPage/> */}

          <div className="mb-5 container-fluid">
            <nav id="MyNavBarId" className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top">
              <button id="NavBarButton" className="navbar-toggler" data-toggle="collapse" data-target="#NavBarCollaps" aria-controls="navbar" aria-expanded="false" aria-label="Toggle navigation">
                <span id="" className="navbar-toggler-icon"></span>
              </button>
              <div id="NavBarCollaps" className="collapse navbar-collapse justify-content-between">
                <Link to={'/livret'} className="navbar-brand"> Afficher le Livret de Famille </Link>
                <Link to={'/arbre'} className="navbar-brand"> Afficher l'Arbre de la Famille </Link>
                <Link to={'/album'} className="navbar-brand"> Afficher l'Album </Link>
              </div>
            </nav>
          </div>
          <hr />
          <div className="container" id="mainId">
            <Routes>
              <Route exact path="/livret" element={<LivretPage/>} />
              <Route path="/arbre" element={<ArbrePage/>} />
              <Route path="/album" element={<AlbumPage/>} />
            </Routes>
          </div>
        </div>
      </Router>
  );
}

export default App;
